import React from "react";
import Container from "react-bootstrap/Container";
import ContentForm from "../form/ContentForm";
import PageHeading from "../headings/PageHeading";
import Col from "react-bootstrap/Col";
import CardParagraph from "../cards/CardParagraph";
import Row from "react-bootstrap/Row";

function Contact() {
  return (
    <>
      <Container>
        <Row>
          <Col xl xs={12} md={12} md={{ order: "first" }}>
            <PageHeading content="Submit your details" />
          </Col>
          <Col md={6} xs={12} xs={{ order: "last" }}>
            <ContentForm />
          </Col>
          <Col md={6} xs={12} xs={{ order: "first" }}>
            <Container>
              <CardParagraph content="Telephone" />
              <CardParagraph content="Email" />
              <CardParagraph content="Address" />
            </Container>
          </Col>
        </Row>
      </Container>
    </>
  );
}

export default Contact;
